export const Messages = '/instructor/communication/messages';
export const Announcements = '/instructor/communication/announcements';
export const Qa = '/instructor/communication/qa';
export const Assignments = '/instructor/communication/assignments';
export const Courses = '/instructor/courses';
export const Overview = '/instructor/performance/overview';
export const Traffic = '/instructor/performance/conversion';
export const Students = '/instructor/performance/students';
export const Reviews = '/instructor/performance/reviews';
export const Engagement = '/instructor/performance/engagement';

export const routesDashboard: Record<string, RouteMeta> = {
    [`${paths.Courses}`]: {
        scene: Courses,
        pageName: undefined,
    },

    [`${paths.Assignments}`]: {
        scene: Assignments,
        pageName: undefined,
    },

    [`${paths.Messages}`]: {
        scene: Messages,
        pageName: undefined,
    },

    [`${paths.Qa}`]: {
        scene: QandA,
        pageName: undefined,
    },
    [`${paths.Announcements}`]: {
        scene: Announcements,
        pageName: undefined,
    },
    [`${paths.Overview}`]: {
        scene: Overview,
        pageName: undefined,
    },
    [`${paths.Reviews}`]: {
        scene: Reviews,
        pageName: undefined,
    },
    [`${paths.Students}`]: {
        scene: Students,
        pageName: undefined,
    },
    [`${paths.Engagement}`]: {
        scene: Engagement,
        pageName: undefined,
    },
    [`${paths.Traffic}`]: {
        scene: Traffic,
        pageName: undefined,
    },

}
